import logging
import time
from functools import wraps

def timed_execution(log_level=logging.INFO):

    def decorator(func):

        @wraps(func)
        def wrapper(*args, **kwargs):
            logger = logging.getLogger(func.__name__)
            start_time = time.time()
            try:
                result = func(*args, **kwargs)
                end_time = time.time()
                logger.log(log_level, f'{func.__name__}{end_time - start_time:.4f} seconds')
                return result
            except Exception as e:
                end_time = time.time()
                logger.log(log_level, f'{func.__name__} execution failed: {e}, executed in {end_time - start_time:.4f} seconds')
                raise
        return wrapper
    return decorator

